import React from 'react';
import {Header} from './components/headerComponent/header'
import {Footer} from './components/footerComponent/footer'
import {NavBar} from './components/navbarComponent/navbar'
import {BookContainer} from './components/booksContainerComponent/booksContainer'
import {EventContainer, EventsContainer} from './components/eventsContainerComponent/eventsContainer'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom'

import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">

        <Header/>
        <NavBar/>
        <main>        

          <Route exact path="/contents">

          </Route>
          <Route exact path="/rules"></Route>
          <Route exact path="/contact"></Route>
          <Route exact path="/">
            <EventsContainer title='Upcoming Events and Announcements'/>
            <BookContainer title='New and Noteworthy' tag='none'/>
          </Route>

        </main>
        <Footer/>

      </div>
    </Router>

  );
}

export default App;
